INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (1, 321, 40011, 24001, 125801, 1, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 2, 0, 1, "リリ");
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (1, 322, 40011, 24001, 126001, 2, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 2, 0, 1, "クリア");
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (1, 323, 40011, 24001, 126101, 3, "んーと。\nこれ、あげる。\nはい", 2, 0, 1, "プレシア");
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (1, 324, 40011, 24001, 125801, 4, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 2, 0, 2, "リリ");
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (1, 325, 40011, 24001, 126001, 5, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 2, 0, 2, "クリア");
INSERT INTO `v1_d05902a88fc3e763287be444282e72b367d62dda5ea0419d6ae83d574834eadc` VALUES (1, 326, 40011, 24001, 126101, 6, "お兄。\nきてくれて、うれしい", 2, 0, 2, "プレシア");
